var objCookie = {}; //cookie 对象
/*
 * @author w3cschool
 * @date 2017-06-27
 * @desc 获得cookie值
 * @param string c_name:key 值
 * @return  get sucuess return value ,get false return ""
 * */
objCookie.getCookie = function(c_name) {
    if (document.cookie.length > 0) {
        c_start = document.cookie.indexOf(c_name + "=");
        if (c_start != -1) {
            c_start = c_start + c_name.length + 1;
            c_end = document.cookie.indexOf(";", c_start);
            if (c_end == -1)
                c_end = document.cookie.length;
            return decodeURIComponent(document.cookie.substring(c_start, c_end));
        }
    }
    return "";
}
/*
 * @author w3cshool
 * @date 2017-06-27
 * @desc 设置cookie值
 * @param string c_name:key值 string value : value值  expriedays: int 过期天数
 * */

objCookie.setCookie = function(c_name, value, expiredays) {
    var exdate = new Date();
    exdate.setDate(exdate.getDate() + expiredays);
    document.cookie = c_name + "=" + decodeURIComponent(value) +
        ((expiredays == null) ? "" : ";expires=" + exdate.toGMTString());
}

/*
 * 获得url参数
 * @author add by onewan
 * @date 2016-09-21
 * @param url key值
 * @return 成功返回 value值，失败返回null
 * */

//获得url参数函数
objCookie.getUrlParam = function(name) {
    //构造一个含有目标参数的正则表达式对象
    var reg = new RegExp("(^|&)" + name + "=([^&]*)(&|$)");
    //匹配目标参数
    var r = window.location.search.substr(1).match(reg);
    //返回参数值
    if (r != null)
        return decodeURIComponent(r[2]);
    return null;
}


$(document).ready(function() {
    var e_keywordid = objCookie.getUrlParam('e_keywordid');
    var IDEA_ID = objCookie.getUrlParam('IDEA_ID');

    /*
     * 当未有值时
     * */
    if (null != e_keywordid) {
        objCookie.setCookie('from_baidu_url', window.location.href);

    }

    if (null != IDEA_ID) {
        objCookie.setCookie('from_baidu_url', window.location.href);

    }
    /*匹配到BDJG*/
    if (-1 != window.location.href.indexOf('BDJG')) {
        objCookie.setCookie('from_baidu_url', window.location.href);
    }

    // 社区团购生鲜配送净菜加工. 底部按钮
    var isOpen = false, modalBottom = ''

    if ($('.modalFixed')[0]) {
        modalBottom = '-' + ($('.modalFixed').height() - $('.modalFixed__header').height()) + 'px'
        $('.modalFixed').css({
            'bottom': modalBottom,
        })
    }

    $('.modalFixed__header').click(function(e){
        isOpen = true
        $('.modalFixed').addClass('active');
        document.body.style.overflow = 'hidden';
        e.stopPropagation();
        return false
    })
    $('.modalFixed__close, .modalFixed__bg').click(function(e){
        $('.modalFixed').removeClass('active');
        document.body.style.overflow = 'auto';
        e.stopPropagation();
        return false;
    })

    // 软键盘弹起来的时候
    var winHeight = $(window).height()
    $(window).resize(function () {
        var thisHeight = $(this).height()
        if (!isOpen) return
        if (winHeight - thisHeight > 50) {
            // 处理小米 qq 浏览器的兼容性问题
            // 确保软键盘弹出隐藏可以切换样式
            if ($('.modalFixed')[0] && $('.modalFixed').attr('style').indexOf('border-box') > -1) {
                $('.modalFixed').css("cssText", "height:auto !important;bottom:" + modalBottom);
            }
            else {
                $('.modalFixed').css("cssText", "height:" + (thisHeight - 50) + "px !important;box-sizing:border-box;");
            }

        }
         else {
            $('.modalFixed').css("cssText", "height:auto !important;bottom:" + modalBottom);
        }
    })
});

