    $(".province").change(function() {
        var $this = $(this),
            cityId = $this.data('city');
        updateCityHtml(cityId);
    });

    function updateCityHtml(cityId) {
        var html = '<option value="">选择城市</option>';
        var pid = $(".province").val();
        if (pid) {
            $.getJSON("<?=$this->createUrl('regionInfo')?>", { pid: pid },
                function(ret) {
                    if (ret.data) {
                        $.each(ret.data, function(id, name) {
                            var selected = id == cityId ? 'selected' : '';
                            html += '<option value="' + id + '" ' + selected + '>' + name + '</option>';
                        });
                    }
                    $("#city").html(html);
                });
        } else {
            $("#city").html(html);
        }
    }
